import React from 'react'
import Axios from 'axios'

function displayData(array){
    if(array){
    array.forEach(ele => {
        return <p>{ele}</p>
    })}
}
function Databases(){

    const [array, setArray] = React.useState();

    React.useEffect(() => {
        try {
            Axios.get("/test").then((response) => {
                setArray(response.data.rows)
            })
        } catch (err){
            console.log(err);
        }
    }, [])

    console.log(array)
    return(
        <div>
            <h1>Databases</h1>
            <div>
                {displayData(array)}
            </div>
        </div>
    )
}

export default Databases;
